// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SysPostRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SysPost) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSysPostByConditionPrefix))
	keys = append(keys, s.cache.Key(CacheSysPostUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSysPostByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysPostUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysPostByTenantIDPrefix, item.TenantID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysPostUnscopedByTenantIDPrefix, item.TenantID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
